import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import "./App.css";
import MainPage from "./Components/MainPage";
import LandingPage from "./Components/LandingPage"
import React, { useState } from "react";
import randomRecipes from'./randomRecipes.json'
import Instructions from './Components/Instructions';


function App() {

  return (
    <BrowserRouter>
      <div>
        {/* The HTML */}
        <Instructions 
          sourceUrl={randomRecipes.recipes[1].sourceUrl}
          image={randomRecipes.recipes[1].image} 
          dishType={randomRecipes.recipes[1].dishTypes[0] && randomRecipes.recipes[1].dishTypes[0].toUpperCase()} 
          title={randomRecipes.recipes[1].id}
          readyInMinutes={randomRecipes.recipes[1].readyInMinutes}
          aggregateLikes={randomRecipes.recipes[1].aggregateLikes}
          instructions={randomRecipes.recipes[1].analyzedInstructions}
        />
        {/* The React Router that makes the HTML above work */}
        <Routes>
          <Route path="/landing" element={<LandingPage />} />
          <Route path="/" element={<MainPage />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
